import React from "react";
import Header from "../Header";
import './Apartament.css'
import CheckInSection from '../CheckInSection'
import HotelRoom from "./HotelRoom";
import room1 from '../images/room-1.jpg'
import room2 from '../images/room2.jpg'
import room3 from '../images/room7.jpg'
import room4 from '../images/room14.jpg'
import { useState } from "react";

export default function Apartament(){
    const[state,setState]=useState([<HotelRoom/>,<HotelRoom/>,<HotelRoom/>,<HotelRoom/>])
    console.log(state);
    function handleClick(){
        return(
            <>
            {console.log(state)}
            </>
        )
    }
    return(
        <>
        {state.map(()=>{
            return(
                <div>
                    <div key={i}>{state[i]}</div>

                </div>
            )
        })}
        <div className="book-background">
        <Header background2={`background2`} background={`back2`} backApart={`backapart`}/>
        <CheckInSection
         HotelRoom={<HotelRoom suite='Junior Suite' size='260'bed='2' price='350' src={room1} handleClick={handleClick}/>}
         HotelRoom1={<HotelRoom suite='Standart Room' size='230'bed='1' price='250' src={room2} handleClick={()=>handleClick}/>}
         HotelRoom2={<HotelRoom suite='Superior Room' size='270'bed='1' price='550' src={room3} handleClick={()=>handleClick}/>}
         HotelRoom3={<HotelRoom suite='Standart Room' size='280'bed='2' price='250' src={room4} handleClick={()=>handleClick}/>}/>
        </div>
        </>
    )
}
